import React, { Component } from "react";
import './css/style.css';
class Image extends Component {

    render() { 
        let imgArray= this.props.obj;
        return ( 
        <React.Fragment>
     {
            imgArray.map((value,index)=>

                <div id="img" key={index}style={{position:'relative'}}>
                    <img style={{width:"300px", height:"500px"}} src={value}  alt="Images"/>
                    {/* <img src='/star.png' style={{
                        bottom:0,right:0,opacity:0.5,
                        width:"20px",height:"20px",position:'absolute'}}alt='star'/> */}
                    <img src="/download.png" className="middle" style={{
                        position:"absolute",width:"20px",height:'20px',bottom:'0',right:'0'}}/>
                </div>
            )
        }
        </React.Fragment>)

    }
}
export default Image;
